import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter } from 'react-router-dom';
import MyApp from './FInalReactProject/MyApp';

ReactDOM.render(
  <>
    <BrowserRouter>
      <MyApp />
    </BrowserRouter>
  </>,
  document.getElementById('root')
);

